import './Home.css';
import React from 'react';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import { IconButton, Typography } from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';


const Home= () =>  {
  return <>
  <Box>
    <Paper
    sx={{
      position:"relative",
      width:"340px",
      display:"flex",
      justifyContent:"space-between",
      mt:"22px",
      pt:"27px",
      pb:"7px",
    }}
   >

    <Typography sx={{ml:"16px" , fontSize:"1.3em"}} variant='h6'>GYM  </Typography>

    <Typography
     sx={{
      mr:"33px", 
      fontSize:"1.4em",
      fontWeight:"500",
      opacity:"0.5",
      }} variant='h6'>$100  </Typography>


      <IconButton sx={{position:"ab"}}>
        <CloseIcon/>
      </IconButton>
    
    


    </Paper>
  </Box>
  
  </>
  
}

export default Home;
